    modified_variance = [0.010426533408447892, 0.005870460839684479, 0.0056252212647749, 0.008353873989751574, 0.007931813101946236, 0.00671281779790487, 0.007374107347340474, 0.006676561024237382]
    proposed_variance = [0.09420846329779825, 0.014060551319738377, 0.017553293863324923, 0.020075655640874754, 0.02496836546606571, 0.021111340341797985, 0.024137990481216044, 0.029390969849569126]

    p = np.polyfit(qubits, np.log(original_variance), 1)  # original poly fitting
    q = np.polyfit(qubits, np.log(modified_variance), 1)  # modified poly fitting
    qubits = np.array(qubits)

    # Plot the straight line fit to the semi-logy
    plt.figure(figsize=(16, 9))
    plt.semilogy(qubits, original_variance, "o", label='Unitary 2-design', color='blue')
    plt.semilogy(qubits, np.exp(p[0] * qubits + p[1]), "o-.", label="Unitary 2-design:Slope {:3.2f}".format(p[0]), linewidth=line_width, color='green')
    plt.semilogy(qubits, modified_variance, 'o', label="Unitary 1-design", color='orange')
    plt.semilogy(qubits, np.exp(q[0] * qubits + q[1]), "o-.", label="Unitary 1-design:Slope {:3.2f}".format(q[0]), linewidth=line_width, color='red')
    plt.semilogy(qubits, proposed_variance, 'o-', label='Proposed Structure', linewidth=line_width, color='purple')
    plt.xlabel(r"N Qubits", fontsize=font_size)
    plt.ylabel(r"Variance of $\partial \theta_{1, 1} E$", fontsize=font_size, fontweight='bold')
    plt.legend(fontsize=legend_size)
    plt.yscale('log')
    plt.tick_params(axis='both', labelsize=label_size, width=3)
    if save:
        plt.savefig('Experiment_2_1.png', dpi=300)
    plt.show()


