    for i in range(4):
        # 1. Epochs-Expectation
        ax = axs[i, 0]
        steps = len(results[i])
        ex = [target[i] for _ in range(steps)]
        ax.plot(ex, color='gray', alpha=0.7, linewidth=line_width, label='Target')
        ax.scatter(range(steps), results_o[i], marker='*', color='green', label='Unitary 2-design')
        ax.scatter(range(steps), results[i], marker='.', color='red', label='Proposed Structure')
        ax.set_ylabel(r"Expectation", fontsize=font_size)
        if i == 3:
            ax.set_xlabel(r"Epochs", fontsize=font_size)
        if i == 0:
            ax.legend(fontsize=legend_size)
        ax.tick_params(width=2, labelsize=label_size)

        # 2. Expectation-Frequency
        ax = axs[i, 1]
        ax.scatter(range(steps), gradients_o[i], marker='*', color='green', label='Unitary 2-design')
        ax.scatter(range(steps), gradients[i], marker='.', color='red', label='Proposed Structure')
        ax.set_ylabel(r"Cost Function", fontsize=font_size)
        if i == 3:
            ax.set_xlabel(r"Epochs", fontsize=font_size)
        if i == 0:
            ax.legend(fontsize=legend_size)
        ax.tick_params(width=2, labelsize=label_size)

        # 3. Expectation-Frequency
        ax = axs[i, 2]
        data_o = results_o[i][300:]
        weights_o = np.ones_like(data_o) / len(data_o)
        kde_o = gaussian_kde(data_o)
        kde_values_o = kde_o(np.arange(-1, 1 + bar_width, bar_width))
        ax.hist(data_o, bins=np.arange(-1, 1 + bar_width, bar_width), color='blue', weights=weights_o, alpha=0.6)
        ax.plot(np.arange(-1, 1 + bar_width, bar_width), kde_values_o / sum(kde_values_o), label='Unitary 2-design', color='green', linewidth=line_width)

        data = results[i][300:]
        weights = np.ones_like(data) / len(data)
        kde = gaussian_kde(data)
        kde_values = kde(np.arange(-1, 1 + bar_width, bar_width))
        ax.hist(data, bins=np.arange(-1, 1 + bar_width, bar_width), color='orange', weights=weights, alpha=0.6)
        ax.plot(np.arange(-1, 1 + bar_width, bar_width), kde_values / sum(kde_values), label='Proposed Structure', color='red', linewidth=line_width)

        if i == 3:
            ax.set_xlabel('Expectation', fontsize=font_size)
        ax.set_ylabel('Frequency', fontsize=font_size)
        if i == 0:
            ax.legend(fontsize=legend_size)
        ax.tick_params(width=2, labelsize=label_size)

